import { Card, Input, Form, DatePicker, List, Button } from "antd";
import Link from "next/link";
import CentralAppLayout from "../../components/CentralAppLayout";
import Router from "next/router";
import { useDispatch, useSelector } from "react-redux";
import moment from "moment";

const ParkingLists = () => {
  const { plateNumbers } = useSelector((state) => state.parking);
  console.log(plateNumbers[0].dueDate[0].toLocaleDateString());
  return (
    <CentralAppLayout>
      <List
        itemLayout="horizontal"
        dataSource={plateNumbers}
        renderItem={(item) => (
          <List.Item>
            <List.Item.Meta
              title={item.plateNumber}
              description={
                <>
                  {item.dueDate[0].toLocaleDateString()} ~ {item.dueDate[1].toLocaleDateString()}
                </>
              }
            />
          </List.Item>
        )}
      />
      <Button>
        <Link href="/parking/regist">
          <a>등록하기</a>
        </Link>
      </Button>
    </CentralAppLayout>
  );
};

export default ParkingLists;
